import React from 'react'
import {  useSelector } from "react-redux";
import { Link } from 'react-router-dom';
import Navbar from '../../components/Navbar/Navbar';
import './Profile.css'


function Profile(){
    const users = useSelector(st=>st.userData.profile)    

    return(
        <>
        <Navbar/>
        <div className='profileBg'>
         {/* <h1> {users.name} {users.surname}! Welcome To Your Profile Page</h1> */}


         <div classNamw="card" style="width: 18rem;">
  <img src="..." classNamw="card-img-top" alt="..."/>
  <div classNamw="card-body">
    <h5 classNamw="card-title">Card title</h5>
    <p classNamw="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" classNamw="btn btn-primary">Go somewhere</a>
  </div>
</div>
         <div>

        <Link to="/myProduct">
         <button className='btn'> my product</button>
        </Link>
         <button className='btn'> settings</button>
         <button className='btn'> order</button>
         </div>
        </div>
        </>
    )
}

export default Profile;
